import useFetch from "react-fetch-hook";
import ContactCards from "./ContactCards"
import {useEffect, useState} from "react";

const App = () => {
  // const url = 'https://jsonplaceholder.typicode.com/users'
  // const { isLoading, data, error } = useFetch({ path:url })
  // data && console.log(data)

  data = fetch('https://jsonplaceholder.typicode.com/users')
    .then((response) => response.json())
    .then((json) => console.log(json));
  const [contactList, setContactList] = useState({ initialState:null })
  const [filterQuery, setFilterQuery] = useState({ initialState:null })

  useEffect(() => {
    if (filterQuery) {
      //do something
    }
    else {
      setContactList(data?.results)
    }
  }, (deps:[data, filterQuery]))

  return (
    <div className = {"bg-gray-100"}> 
      <section> 
        <form>
          <input
            type = "text"
            className = "ml-20 mt-6 rounded-md p-2" 
            placeholder="type here to filter..." 
          />
        </form>
      </section>
      <section className = "p-20 grid sm:grid-cols-2 md:grid-cols-4 gap-6">
        <ContactCards contactList = {contactList}/>
      </section>
    </div>
  );
}

export default App;
